def translate(seq):
    
    seq = seq.upper()
    
    protein = []
    n = len(seq)
    if n % 3 != 0:
        print("nukleotidas nedalus is 3")
        return None
    
    for i in range(0, n, 3):
        codon = seq[i:i + 3]
        frame = frames[codon]
        protein.append(frame)
        
    return "".join(protein)
